const videoApi = async() => {
    await fetch("https://ign-apis.herokuapp.com/videos",{
    method: 'GET',
    headers : { 
        Accept:'application/json',
        'Content-Type': 'application/json'
    }
})
    .then(res=> res.json())
    .then(data=> console.log(data))
    .catch(err => console.log(err))
};

export default videoApi;
